import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import $ from 'jquery';
import Popper from 'popper.js';
import 'bootstrap/dist/js/bootstrap.bundle.min';
import './plantstats.css';
import 'tachyons';
import Navigation from "../../Navigation/Navigation";
import FinalNav from "../../Navigation/FinalNav";

class Rowstats extends Component{

    constructor(props) {
        super(props);
        this.state = {
            number : 11,
            current : 0,
            startDate : null,
            endDate : null,
            name: 'Surya',
        };

        this.onNumberFixed = this.onNumberFixed.bind(this);
        this.onCycleFixed = this.onCycleFixed.bind(this);
        this.onStartDateFixed = this.onStartDateFixed.bind(this);
        this.onEndDateFixed = this.onEndDateFixed.bind(this);
    }

    pr = {
        cycle : "<div><span>Clean Cycle</span><strong id='hel'>"+ this.props.number +"</strong></div>",
        select : "<div><span></span><select name='cycleNumber' onChange="+ this.props.onCycleFixed +" > "+ this.props.items +"</select></div>",
        startDate : "",
    };


    render() {
        return(
            <div>
                <FinalNav name={this.state.name} pr={this.pr} />
                <div id="hello1">
                    {/*<div className="input-group">*/}
                    {/*    <div className="input-group-prepend">*/}
                    {/*        <span className='input-group-text'>Clean Cycle</span>*/}
                    {/*        <strong className="hel">11</strong>*/}
                    {/*    </div>*/}
                    {/*</div><br />*/}
                    <div className="input-group">
                        <div className="input-group-prepend">
                            <span className='input-group-text'>Clean Status</span>
                            <em className='hel'><strong>Cleaned</strong></em>
                        </div>
                    </div><br />
                    <div className="input-group">
                        <div className="input-group-prepend">
                            <span className='input-group-text'>Updated Date</span>
                            <strong className="hel">11/06/2019</strong>
                        </div>
                    </div><br />
                    <div className="input-group">
                        <div className="input-group-prepend">
                            <span className='input-group-text'>Updated Time</span>
                            <strong className="hel">11:20 PM</strong>
                        </div>
                    </div><br/>
                    <div className="input-group">
                        <div className="input-group-prepend">
                            <span className="input-group-text">Updated By</span>
                            <strong className="hel">Shyam, Junior Scientist</strong>
                        </div>
                    </div>
                </div>
            </div>
        );
    }

    onNumberFixed(event) {
        this.setState({
            number : event.target.value,
        });
    }

    onCycleFixed(event) {
        this.setState({
            current : event.target.value,
        });
    }

    onStartDateFixed(event) {
        this.setState({
            startDate : event.target.value,
        })
    }
    onEndDateFixed(event) {
        this.setState({
            endDate : event.target.value,
        })
    }



}

export default Rowstats;
